/*Table structure for table `f_trabajador` */

DROP TABLE IF EXISTS `f_trabajador`;

CREATE TABLE `f_trabajador` (
  `id_trabajador` int(11) NOT NULL AUTO_INCREMENT,
  `id_empresaevaluacion` int(11) NOT NULL,
  `identificacion` varchar(15) NOT NULL COMMENT 'numero de documento de identidad',
  `nombres` varchar(300) NOT NULL,
  `apellidos` varchar(300) NOT NULL,
  `genero` char(1) NOT NULL,
  `anio_nacimiento` char(4) NOT NULL,
  `id_estadocivil` int(11) NOT NULL DEFAULT '1',
  `id_nivelestudio` int(11) NOT NULL DEFAULT '1',
  `ocupacion` varchar(300) NOT NULL,
  `ciudad_municipio_residencia` varchar(300) NOT NULL COMMENT 'ciudad donde reside',
  `departamento_residencia` varchar(300) NOT NULL COMMENT 'departamento donde reside',
  `provincia_residencia` varchar(300) NOT NULL COMMENT 'provincia donde reside',
  `distrito_residencia` varchar(300) NOT NULL COMMENT 'distrito conde reside',
  `hacienda_residencia` varchar(300) NOT NULL COMMENT 'hacienda donde reside',
  `estrato` int(1) NOT NULL DEFAULT '1' COMMENT 'nivel socioeconomico de los servicios de la vivienda del trabajador (en colombia son 8 - 1,2,3,4,5,6,7,8)',
  `id_tipovivienda` int(11) NOT NULL DEFAULT '1',
  `personas_a_cargo` int(11) NOT NULL COMMENT 'numero de personas a cargo economicamente',
  `ciudad_municipio_trabajo` varchar(300) NOT NULL COMMENT 'ciudad donde trabaja',
  `departamento_trabajo` varchar(300) NOT NULL COMMENT 'departamento donde trabaja',
  `provincia_trabajo` varchar(300) NOT NULL COMMENT 'provincia donde trabaja',
  `distrito_trabajo` varchar(300) NOT NULL COMMENT 'distrito conde trabaja',
  `hacienda_trabajo` varchar(300) NOT NULL COMMENT 'hacienda donde trabaja',
  `flag_tiempo_trabajo` char(1) DEFAULT NULL,
  `tiempo_trabajo` int(11) NOT NULL COMMENT 'tiempo que trabaja en la empresa',
  `nombre_cargo_ocupa` varchar(300) NOT NULL,
  `id_tipocargo` int(11) NOT NULL DEFAULT '1',
  `flag_tiempo_cargo` char(1) NOT NULL,
  `tiempo_cargo` int(11) unsigned NOT NULL COMMENT 'tiempo que esta en el cargo',
  `area_trabajo` varchar(300) NOT NULL COMMENT 'nombre del area/seccion de la empresa donde trabaja',
  `id_contrato` int(11) NOT NULL DEFAULT '1',
  `horas_trabajo` int(11) NOT NULL COMMENT 'horas de trbajo por dia que la empresa le ordena',
  `id_tiposalario` int(11) unsigned NOT NULL DEFAULT '1',
  `evaluado` char(1) NOT NULL DEFAULT 'N' COMMENT 'S:si esta evaluado, N: no esta evaluado',
  `ip` varchar(50) NOT NULL COMMENT 'ip de la pc desde donde se realiza la evaluacion',
  `fecha_llenado` date NOT NULL COMMENT 'fecha en la q se lleno fisicamente el cuestionario',
  `id_usuariocreacion` int(11) DEFAULT NULL COMMENT 'usuario q llena los cuestionarios',
  `fecha_registro` datetime DEFAULT NULL,
  `id_usuariomodifica` int(11) DEFAULT NULL COMMENT 'usuario q modifica datos generales de trabajador',
  `fecha_modifica` datetime DEFAULT NULL,
  PRIMARY KEY (`id_trabajador`),
  KEY `id_empresa` (`id_empresaevaluacion`),
  KEY `id_estadocivil` (`id_estadocivil`),
  KEY `id_tipovivienda` (`id_tipovivienda`),
  KEY `id_contrato` (`id_contrato`),
  KEY `id_cargo` (`id_tipocargo`),
  KEY `id_nivelestudio` (`id_nivelestudio`),
  KEY `id_tiposalario` (`id_tiposalario`),
  KEY `id_tipocargo` (`id_tipocargo`),
  KEY `id_empresaevaluacion` (`id_empresaevaluacion`),
  CONSTRAINT `f_trabajador_fk` FOREIGN KEY (`id_empresaevaluacion`) REFERENCES `f_empresa_evaluacion` (`id_empresaevaluacion`),
  CONSTRAINT `f_trabajador_fk1` FOREIGN KEY (`id_estadocivil`) REFERENCES `f_estado_civil` (`id_estadocivil`),
  CONSTRAINT `f_trabajador_fk2` FOREIGN KEY (`id_tipovivienda`) REFERENCES `f_tipo_vivienda` (`id_tipovivienda`),
  CONSTRAINT `f_trabajador_fk3` FOREIGN KEY (`id_nivelestudio`) REFERENCES `f_nivel_estudio` (`id_nivelestudio`),
  CONSTRAINT `f_trabajador_fk4` FOREIGN KEY (`id_tiposalario`) REFERENCES `f_tipo_salario` (`id_tiposalario`),
  CONSTRAINT `f_trabajador_fk5` FOREIGN KEY (`id_tipocargo`) REFERENCES `f_tipo_cargo` (`id_tipocargo`),
  CONSTRAINT `f_trabajador_fk6` FOREIGN KEY (`id_contrato`) REFERENCES `f_tipo_contrato` (`id_tipocontrato`)
) ENGINE=InnoDB AUTO_INCREMENT=1400 DEFAULT CHARSET=latin1;

