/* Procedure structure for procedure `dataGrid` */

/*!50003 DROP PROCEDURE IF EXISTS  `dataGrid` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `dataGrid`(
	in _flag int,
	IN _criterio VARCHAR(200),
	in _pagina int,
	in _reg_x_pag int
    )
BEGIN
		
	DECLARE search VARCHAR(200) DEFAULT '';
	DECLARE _pag_actual INT;
	
	SET _pag_actual=(_pagina - 1) * _reg_x_pag;
	
	IF _criterio != '' THEN
		SET search = CONCAT(' WHERE CONCAT(nombres," ",apellidos) LIKE "%',_criterio,'%" ');
	END IF;
	
	SET @sentencia = CONCAT('
	SELECT  
		COUNT(*) INTO @countx  
	FROM f_trabajador 
	',search,';
	');
	
	PREPARE consulta FROM @sentencia;
	EXECUTE consulta;
	
	DEALLOCATE PREPARE consulta;
	SET @sentencia = NULL;
	
	
	SET @sentencia = CONCAT('
	SELECT  
		nombres, 
		apellidos, 
		genero,
		@countx AS total 
	FROM f_trabajador 
	',search,' 
	LIMIT ',_pag_actual,',',_reg_x_pag,';
	');
	
	PREPARE consulta FROM @sentencia;
	EXECUTE consulta;
	
	DEALLOCATE PREPARE consulta;
	SET @sentencia = NULL;
    END */$$
DELIMITER ;

